import React from 'react';
import { Card } from '../components/Card'
import { useSelector } from 'react-redux'


export const CardContainer = () => {
    const states = useSelector(reducer => reducer.objectiveState)
    const clock = useSelector(reducer => reducer.clockState)
    return (
        <div className="container">
            {Object.keys(states.timers).length === 0 ? null : states.timers.filter(timer => 86400000 > timer.end - clock.time && timer.end - clock.time > -3000).map(timer => <Card timer={timer} />)}
            {/* {Object.keys(states.timers).length === 0 ? null : states.timers.map(timer => <Card timer={timer} />)} */}

        </div>
    )
}
